import React from 'react';
import "./input.scss";

const Input = (props) => {

    switch (props.elementType) {
        case ('input'):
            inputElement = <input 
                className="input"
                value={props.value}
                onChange={props.changed} />;
            break;
        
        default:
            inputElement = <input 
                className="input"
                value={props.value}
                onChange={props.changed} />;
    }

    return (
        {inputElement}
    );
}

export default Input;
